import React from 'react';
import {BrowserRouter, Swicth, Route} from 'react-router-dom';
import Main from './pages/main';

const Routes = () => (
    <BrowserRouter>
    <Swicth>
    <Route Path="/" component={Main} />
    </Swicth>
    </BrowserRouter>
);
export default Routes;
